import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";
import a from "./img/a.jpg";

function Cards(props){
    return (
            <Col>
            <Card>
                <img className="card-img" src={props.image} />
                    <Card.Body>
                    <h3>{props.header}</h3>
                    <p>{props.para}</p>
                    </Card.Body>
                </Card>
            </Col>
    )
}

const Portfolio = () => {
    return (
        <div style={{paddingTop: "200pt", paddingBottom: "200pt"}}>
        <Container>
            <Row>
                <Cards header="Yo" para="fdfdsfdsfsfsdfsdfsf" image={a} />
                <Cards header="yoo" para="sdfdsfsfs" />
                <Cards header="fdsfsf" para="fdsfsf" />
            </Row>
        </Container>
        </div> 
     );
}

export default Portfolio;
